import { useRef, useState } from 'react'
import { images } from '../constants'

function LoginAccount() {
  const width = useRef(window.innerWidth).current
  const height = useRef(window.innerHeight).current
  return (
    <div
      style={{
        backgroundColor: '#141518',
      }}
    >
      <div
        style={{
          display: 'flex',
          height: height * 0.08,
          flexDirection: 'row',
        }}
      >
        <div
          style={{
            marginTop: height * 0.011,
            marginLeft: width * 0.005,
            height: height * 0.065,
            display: 'flex',
            flexDirection: 'row',
          }}
        >
          <img
            src={images.thu}
            style={{
              height: 26,
              marginLeft: 5,
              alignSelf: 'center',
            }}
          />
          <span
            style={{
              marginLeft: 3,
              marginRight: 8,
              fontSize: 14,
              fontWeight: '500',
              alignSelf: 'center',
              color: '#eaeaea',
            }}
          >
            Back to T&C
          </span>
        </div>
      </div>
      <div
        style={{
          marginTop: 10,
          height: height * 0.18,
          width: width,
          backgroundColor: 'red',
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center',
        }}
      >
        <img
          src={'https://i.imgur.com/hPbfzZ2.png'}
          alt="Logo image T&C"
          style={{
            height: height * 0.1,
          }}
        />
      </div>
    </div>
  )
}

export default LoginAccount
